import "./index.css";

import { getHeroeById } from "./bases/08-import&export";
import { getHeroeByOwner } from "./bases/08-import&export";

const promesa = new Promise((resolve, reject) => {
  setTimeout(() => {
    // resolve(getHeroeById(2));
    reject("No se pudo encontrar el heroe");
  }, 2000);
});

promesa
  .then((heroe) => {
    console.log(heroe);
  })
  .catch((err) => {
    console.error(err);
  });
